  // ツールチップ 位置変更
  function processing_tooltip(target, e) {
    var $layer = target.parent(),
      layerWidth = $layer.innerWidth(),
      layerHeight = $layer.innerHeight(),
      layerPdd = parseInt($layer.get(0).style.padding),
      tipsWidth = target.innerWidth(),
      tipsHeight = target.innerHeight();
    target.find('li').on('click', function(e) {
      if (e.target.className == 'sub_root') {
        return;
      } else {
        $layer.hide();
      }
    });
    var overX = (e.clientX + layerWidth) - $(window).width(),
      newX = e.pageX - overX;
    if (overX > 0) {
      if (overX < layerPdd) {
        newX = e.pageX - layerPdd;
      }
      $layer.css('left', newX + 'px');
    }
    var overY = (e.clientY + layerHeight) - $(window).height(),
      newY = e.pageY - overY;
    if (overY > 0) {
      if (overY < layerPdd) {
        newY = e.pageY - layerPdd;
      }
      $layer.css('top', newY + 'px');
    }
    target.find('li.sub_root').hover(function() {
      var $children = $(this).children('ul'),
        layerOsTop = $layer.offset().top,
        thsOsTop = $(this).offset().top,
        thsIntop = (thsOsTop - layerOsTop) + $(this).innerHeight(),
        cssLeft = layerPdd + tipsWidth - 1,
        cssTop = thsOsTop - layerOsTop - 3,
        cssBottom = (layerHeight - thsIntop) - 3;
      var sub_overX = (e.clientX + layerPdd + (tipsWidth * 2)) - $(window).width(),
        sub_newX = cssLeft - ($children.innerWidth() + tipsWidth - 2),
        sub_overY = ((thsOsTop + $children.innerHeight()) - $(window).scrollTop()) - $(window).height();
      var $css;
      if (sub_overX > 0 && sub_overY <= 0) {
        $css = {
          'left': sub_newX + 'px',
          'top': cssTop + 'px'
        };
      } else if (sub_overX <= 0 && sub_overY > 0) {
        $css = {
          'left': cssLeft + 'px',
          'bottom': cssBottom + 'px'
        };
      } else if (sub_overX > 0 && sub_overY > 0) {
        $css = {
          'left': sub_newX + 'px',
          'bottom': cssBottom + 'px'
        };
      } else {
        $css = {
          'top': cssTop + 'px',
          'left': cssLeft + 'px'
        };
      }
      $children.removeAttr('style').css($css).show();
    }, function() {
      $(this).children('ul').hide();
    });
  }
