  //資源バーの表示アイテム変更
  function statusDisplay() {
    if (!options.status_display) {
      return;
    }
    var kind = ['wood', 'stone', 'iron', 'rice'],
      max = parseInt($('#' + kind[0] + '_max').text()),
      $li = $('#status_left li'),
      $slice = $li.slice(0, 4),
      $img = $slice.find('img'),
      stock = [],
      rate = [],
      poss = [],
      rema = [],
      num, param, str, unit,
      i, len = kind.length;
    //数値の取得
    for (i = 0; i < len; i++) {
      str = $('#' + kind[i]).text();
      num = parseInt(str);
      stock[i] = addFigure(str); //貯蓄量
      rate[i] = parseInt($('#output_' + kind[i]).text()); //1h生産量
      poss[i] = Math.floor((num / max) * 100); //保有率
      rema[i] = Math.floor((max - num) / rate[i]); //残り時間
    }
    if (options.status_display_mod === '1') {
      param = rema;
      unit = 'h';
    } else {
      param = poss;
      unit = '%';
    }
    //アイテムの追加
    var html = '';
    for (i = 0; i < len; i++) {
      html += '<li>' + $img.eq(i)[0].outerHTML + '&nbsp;' +
            '<span class="normal" id="' + kind[i] + '_store">' + stock[i] + '</span>&nbsp;/&nbsp;' +
            '<span class="normal" id="' + kind[i] + '_rate">' + param[i] + unit + '</span>' +
            '<div class="groove"><span id="' + kind[i] + '_advance" /></div>' +
          '</li>';
    }
    html += '<li><span title="蔵容量">' + addFigure(max) + '</span></li>';

    $slice.hide();
    $li.last().before(html);

    var $store, $rate, $advance;
    setInterval(function() {
      for (i = 0; i < len; i++) {
        $store = $('#' + kind[i] + '_store');
        $rate = $('#' + kind[i] + '_rate');
        $advance = $('#' + kind[i] + '_advance');
        $li = $advance.closest('li');
        //数値の取得
        str = $('#' + kind[i]).text();
        num = parseInt(str); //貯蓄量
        poss = Math.floor((num / max) * 100); //保有率
        rema = Math.floor((max - num) / rate[i]); //残り時間
        //更新
        $store.text(addFigure(str));
        if (options.status_display_mod === '1') {
          $rate.text(rema + 'h');
          $li.attr('title', poss + '%');
        } else {
          $rate.text(poss + '%');
          $li.attr('title', rema + 'h');
        }
        $advance.width(poss + '%');
        //カラーの変更
        if (poss == 100) {
          $advance.css({
            'background-color': 'magenta'
          });
        } else if (poss >= 90) {
          $advance.css({
            'background-color': 'red'
          });
        } else if (poss >= 80) {
          $advance.css({
            'background-color': 'gold'
          });
        }
      }
    }, 1000);
    //名声値
    var $fame_groove = $('<div id="fame_groove" />')
        .appendTo($('img[alt="名声"]').parent('li'));
    if (fame() <= 5) {
      $fame_groove.css('background-color', 'red');
    }
  }
