  //座標っぽい文字列からリンクを生成
  function stringsChangeLink(target) {
    var coordReg = new RegExp(/[ー－‐―\-]?[０-９\d]+[,，.．、､]\s?[ー－‐―\-]?[０-９\d]+/g);
    var urlReg = new RegExp(/https?:\/\/[a-zA-Z0-9\-_\.:@!~*'\(¥);/?&=\+$,%#]+/g);
    var i, len, j;
    target.each(function() {
      stringsChangeLink.flag = false;
      var msg = target.hasClass('comment_wbr') ? $(this).html() : $(this).text();
      var coord_arr = msg.match(coordReg);
      var url_arr = msg.match(urlReg);
      if (coord_arr) {
        for (i = 0, len = coord_arr.length; i < len; i++) {
          var num_arr = coord_arr[i].match(/[ー－‐―\-]?[０-９\d]+/g);
          for (j = 0; j < 2; j++) {
            num_arr[j] = toHankaku(num_arr[j]);
          }
          msg = msg.replace(new RegExp(coord_arr[i], 'g'), '<a class="mk_create_link" style="display:inline;" href="/map.php?x=' + num_arr[0] + '&y=' + num_arr[1] + '">' + coord_arr[i] + '</a>');
        }
        stringsChangeLink.flag = true;
      }
      if (url_arr) {
        for (i = 0, len = url_arr.length; i < len; i++) {
          msg = msg.replace(url_arr[i], '<a class="mk_create_link" href="' + url_arr[i] + '" target="_blank">' + url_arr[i] + '</a>');
        }
        stringsChangeLink.flag = true;
      }
      if (stringsChangeLink.flag) {
        $(this).html(msg);
      }
    });
  }
