  // 拠点移動のURLの取得・移動
  function moveExecution(f) {
    var $on = $('#sideboxBottom li.on');
    var $div = $on.closest('div');
    var getDestination = function (el, idx) {
      return {
        prev: $on.prev('li').not('.head').length ? $on.prev().children('a').attr('href') : el.last().children('a').attr('href'),
        next: $on.next().length ? $on.next().children('a').attr('href') : el.eq(idx).children('a').attr('href')
      }
    };
    var obj = {};
    var o = {};
    if ($div.hasClass('my_capital')) {
      var $li = $('div.my_country li', 0);
      obj.prev = $li.last().children('a').attr('href');
      obj.next = $li.first().children('a').attr('href');
    } else if ($div.hasClass('my_country')) {
      o = getDestination($('div.my_capital li'), 0);
      obj.prev = o.prev;
      obj.next = o.next;
    } else {
      o = getDestination($div.find('li'), $div.find('li.head').length);
      obj.prev = o.prev;
      obj.next = o.next;
    }
    if ($('#repair_central_form').length) {
      obj.prev = obj.prev.replace('map', 'village');
      obj.next = obj.next.replace('map', 'village');
    }

    var url = 0 > f && obj.prev ? obj.prev : 0 < f && obj.next ? obj.next : null;
    url ? location.href = url : void 0;

  }
  //実行中作業の時間をサイドボックスにカウント表示
  function buildTimeDisplay() {
    var build_time = getStorage({}, 'ixamoko_build_time');
    //Timer
    var buildTimer,
    buildClock = function(build_time) {
      buildTimer = setInterval(function() {
        var aflg = false, nd = new Date(), fact = [],
          rtime, tmpl, min, sub, bt_toSec, hh, mm, ss;

        for (var key in build_time) {
          tmpl = build_time[key].text.match(/\d+/g);
          min = tmpl[0] * 3600 + tmpl[1] * 60 + tmpl[2] * 1;
          sub = Math.floor((nd.getTime() - build_time[key].stamp) / 1000);
          bt_toSec = min - sub;

          if (bt_toSec <= 0) {
            aflg = true;
            fact.push(build_time[key].base + ' [' + build_time[key].name + ']');
            $('span[id="' + key + '"]').css('color', 'crimson');
            delete build_time[key];
          }
          rtime = timeStringConvert(bt_toSec);
          $('span[id="' + key + '"]').html(rtime);
        }
        if (aflg) {
          moko_notice(makeLog('実行中作業が完了しました', fact, ' '));
          clearInterval(buildTimer);
          setStorage('ixamoko_build_time', build_time);
          return start_build_time();
        }
      }, 1000);
    },
    start_build_time = function() {
      if (!Object.keys(build_time).length) {
        return;
      }
      clearInterval(buildTimer);
      return buildClock(build_time);
    },
    build_time_view = function(build_time) {
      var target = $('#sideboxBottom div.basename > ul > li:not(.head)'),
        text, tmpl;
      for (var key in build_time) {
        for (var i = 0, len = target.length; i < len; i++) {
          text = target.eq(i).children().eq(0).text();
          if (text != build_time[key].base) {
            continue;
          }
          tmpl = $('<div class="timeLeft">' + build_time[key].name +
            '(<span id="' + key + '">' + build_time[key].text + '</span>) </div>').css('color', build_time[key].color);
          target.eq(i).append(tmpl);
        }
      }
      return start_build_time();
    },
    $sideboxBottom = $('#sideboxBottom');
    var $h4 = $sideboxBottom.find('h4:contains("自国")').eq(0);
    var $a = $h4.children('a');
    $h4.append('<label id="build_time"><input type="checkbox" id="build_time_mod" />建築/研究</label>');
    if ($a.length) {
      var str = $a.text().match(/\(.+?\)/)[0];
      $a.text('自国').attr('title', str);
      $('#build_time').css({
        'float': 'none',
        'margin-left': '6px'
      });
    }
    var $input = $('#build_time_mod')
      .prop('checked', each_setting.build_time_mod)
      .on('change', function () {
        each_setting.build_time_mod = $(this).prop('checked');
        setStorage('ixamoko_each_setting', each_setting);
        var $timeLeft = $sideboxBottom.find('div.timeLeft');
        if ($timeLeft.length) {
          $timeLeft.toggle();
        } else {
          return build_time_view(build_time);
        }
      });
    if (!$input.prop('checked')) {
      return;
    }
    //所領
    if (location.pathname == '/village.php') {
      var baseName = $('#basepointMain span.basename').text(),
        names = [],
        keys = [],
        uniques,
        diffs,
        key;

      $sideboxBottom.find('div.basename li:not(.head)').each(function () {
        names.push($(this).children().eq(0).text());
      });

      for (key in build_time) {
        keys.push(build_time[key].base);
        if (key.indexOf(baseName) == -1) {
          continue;
        }
        delete build_time[key];
      }

      uniques = arrayUnique(keys);
      diffs = arrayDiff(uniques, names);

      for (key in build_time) {
        for (var i = 0, len = diffs.length; i < len; i++) {
          if (build_time[key].base == diffs[i]) {
            delete build_time[key];
          }
        }
      }

      $('#actionLog ul > li, div.new_worldmap_mappanel_body ul > li').each(function() {
        var text = $(this).find('span.buildStatus').text(),
        buildName, color, lv;
        if ($(this).text().indexOf('削除中') != -1) {
          lv = (text.match(/\（.+?\）/) || [])[0];
          buildName = text.replace(lv, '');
          color = 'darkgray';
        } else if (text.indexOf('研究中') != -1) {
          buildName = text.replace('を研究中です。', '');
          color = 'lightBlue';
        } else if (text.indexOf('陣の破棄') != -1) {
          buildName = '破棄中';
          color = 'darkgray';
        } else {
          lv = (text.match(/\（.+?\）/) || [])[0];
          buildName = text.replace(lv, '').replace($(this).find('span.status').text(), '');
          color = '#eee';
        }
        var buildTime = $(this).find('span.buildTime').text(),
          buildClock = $(this).find('span.buildClock').text(),
          stamp = new Date().getTime(),
          key = buildTime + '_' + buildName + '_' + baseName;

        build_time[key] = {
            base: baseName,
            name: buildName,
            text: buildClock,
            stamp: stamp,
            color: color
          };
      });
      setStorage('ixamoko_build_time', build_time);
    } else if (location.hash.indexOf('#/land') != -1) {
      //開拓地・陣・出城
      var hashBuildTime = function(baseName) {
        var $ul = $('div.new_worldmap_mappanel_window_wrap ul');
        for (var key in build_time) {
          if (key.indexOf(baseName) == -1) {
            continue;
          }
          delete build_time[key];
        }
        $ul.children('li').each(function() {
          var now_text = $('span.build_now').text(),
            text = $(this).find('span.buildStatus').text();
          var buildName = text.replace(now_text, ''),
            buildTime = $(this).find('span.buildTime').text(),
            buildClock = $(this).find('span.buildClock').text(),
            stamp = new Date().getTime(),
            key = buildTime + '_' + buildName + '_' + baseName,
            color = '#eee';

          if (buildName.indexOf('建設中陣') != -1) {
            buildName = buildName.replace('建設中陣', '');
          }
          if (buildName.indexOf('建設中出城') != -1) {
            buildName = buildName.replace('建設中出城', '');
          }
          if (buildName.indexOf('陣の破棄') != -1) {
            buildName = '破棄中';
            color = 'darkgray';
          }
          build_time[key] = {
            base: baseName,
            name: buildName,
            text: buildClock,
            stamp: stamp,
            color: color
          };
        });
        setStorage('ixamoko_build_time', build_time);
      },
      getVillageName = function() {
        var text = $('#village_name').text();
        if (text == ' ') {
          setTimeout(getVillageName, 1);
        } else {
          return hashBuildTime(text);
        }
      };

      getVillageName();
    }

    return build_time_view(build_time);
  }
