  // デッキ 討伐ゲージの回復時間表示
  function deckRecoveryTime() {
    $('div[id^="id_deck_card"]').find('div.battlegage').each(function() {
      var battlepoint = parseInt($(this).find('span.ig_deck_battlepoint').text());
      var purpose, remain, timeText, dayText, html;
      if (battlepoint === 500) {
        return;
      } else if (battlepoint < 300) {
        purpose = 300;
      } else if (battlepoint < 400) {
        purpose = 400;
      } else if (battlepoint < 500) {
        purpose = 500;
      }
      remain = (purpose - battlepoint) * 162;
      timeText = timeStringConvert(remain);
      dayText = completTimeConvert(new Date(), timeText);
      html = '<div class="toubatsu_deck">' + purpose + 'まであと <span>' + timeText + '</span> (' + dayText + ')</div>';
      $(this).append(html);
      $(this).next().css('margin-top', '14px');
    });
  }
  // 待機武将一覧 HP・討伐ゲージのカウントダウン
  function countdown_recovery() {
    function create_recovery_data(target, text, type) {
      var $cardarea = target.closest('div.ig_deck_smallcardarea'),
        data = get_deck_cardarea($cardarea),
        start = new Date(),
        name = data.name;
      return {
        target: target,
        start: start,
        text: text,
        name: name,
        type: type
      };
    }

    var list = [],
    text, neme, type, data;
    $('div.battle > p > span, div.hp > p > span').each(function() {
      text = $(this).text();
      name = $(this).closest('div').attr('class');
      if (text == '00:00:00') {
        return true;
      }
      if (name.indexOf('battle') != -1) {
        type = 'battle';
      } else {
        type = 'hp';
      }
      data = create_recovery_data($(this), text, type);
      list.push(data);
    });
    clearInterval(recoveryTimer);
    return interval_recovery(list);
  }
  var recoveryTimer;
  function interval_recovery(data) {
    recoveryTimer = setInterval(function() {
      var aflg = false, hh, mm, ss, nd = new Date(), rtime,
        hp_list = [], pu_list = [];
      for (var i = 0, len = data.length; i < len; i++) {
        var tmp = data[i].text.match(/\d+/g),
          bt_toSec = tmp[0] * 3600 + tmp[1] * 60 + tmp[2] * 1 - Math.floor((nd.getTime() - data[i].start.getTime()) / 1000);
        if (bt_toSec <= 0) {
          aflg = true;
          if (data[i].type == 'hp') {
            hp_list.push(data[i].name);
          } else {
            pu_list.push(data[i].name);
          }
        }
        rtime = timeStringConvert(bt_toSec);
        data[i].target.text(rtime);
      }
      if (aflg) {
        if (hp_list.length) {
          moko_notice(makeLog('HPが全回復しました', hp_list));
        }
        if (pu_list.length) {
          moko_notice(makeLog('討伐ゲージ300到達', pu_list));
        }
        clearInterval(recoveryTimer);
        return countdown_recovery();
      }
    }, 1000);
  }
