  // カードポップアップウィンドウ
  function ajaxContent() {
    //カード画像枠消し
    $('body').on('click', '#TB_ajaxContent div.ig_card_cardStatusFront', function(e) {
      if (e.target.tagName == 'A') {
        return;
      }
      var target = $(this).find('img.ig_card_parameta, div.parameta_area, img.ig_card_frame'),
        $visible = target.filter(':visible').length;
      if ($visible === 3) {
        target.filter('img.ig_card_parameta, div.parameta_area').hide();
      } else if ($visible === 1) {
        target.filter('img.ig_card_frame').hide();
      } else {
        target.show();
      }
    });

    $('body').on('mousedown', 'a[href*="inlineId=cardWindow_"]', function() {
      var cid = $(this).attr('href').match(/\d+/g)[2],
      $cardWindow = $('#cardWindow_' + cid),
      data = get_card_data($cardWindow),
      name = data.sname[0],
      getBasic = function(name, o, no) {
        var a = [];
        for (var key in o) {
          if (no.match(/4147|6055/)) {
            if ('攻：' + name == key) {
              a = o[key];
              break;
            }
          } else {
            if (name == key.split('：')[1]) {
              a = o[key];
              break;
            }
          }
        }
        return a;
      },
      getCandidate = function(a, o) {
        var array = ['-','-','-','-','-'];
        for (var key in o) {
          for (var i = 0, len = a.length; i < len; i++) {
            if (key == a[i]) {
              array[i] = o[key][3];
            }
          }
        }
        return array;
      },
      adjustTB_window = function() {
        var $TB_window = $('#TB_window');
        if (!$TB_window.get(0)) {
          setTimeout(adjustTB_window, 1);
        } else {
          var param = $(window).height() - $TB_window.outerHeight(),
          csstop = param / 2,
          hash;
          if (csstop < 0) {
            csstop = 10 + $(window).scrollTop();
            hash = {
              'position': 'absolute',
              'margin-top': '0',
              'top': csstop
            };
          } else {
            hash = {
              'margin-top': '0',
              'top': csstop
            };
          }
          $TB_window.css(hash);
        }
      },
      html;

      if (location.pathname == '/card/deck.php' &&
        !$cardWindow.find('#tb_one_set_link_' + cid).length) {
        var $table = $cardWindow.find('#table_posi');

        html = '<span id="tb_one_set_link_' + cid + '"> (<span>1</span>) </span>';
        $table.find('input.input_kazu').after(html);

        $('span[id^="tb_one_set_link_"]').on('click', function() {
          $('#unit_cnt_text_' + cid).val($(this).find('span').text());
          return changeNum(cid);
        });
        $('select[id^="unit_id_select_"').on('change', function() {
          if (!$(this).val()) { $('#unit_cnt_text_' + cid) .val(0); }
          return changeNum(cid);
        });
        $('#unit_set_link_' +cid).on('click', function() {
          changeNum(cid);
          return false;
        });
        $('input[id^="btn_change_"]').on('click', function() {
          return max_check(cid);
        });
      }
      //スキル候補
      var c1 = getBasic(name, SKILL_CANDIDATE, data.card_no);
      var c2 = getCandidate(c1, SKILL_CANDIDATE);
      var c3 = getCandidate(c2, SKILL_CANDIDATE);
      var clist = [ c1, c2, c3 ];

      html = '<table id="moko_candidate_' + cid + '" class="common_table1">' +
        '<tbody><tr><th>A</th><th>B</th><th>C</th><th>S1</th><th>S2</th></tr>';

      if (c1.length) {
        for (var i = 0, len = clist.length; i < len; i++) {
          html += '<tr><td>' + clist[i][0] + '</td><td>' + clist[i][1] + '</td><td>' + clist[i][2] + '</td>' +
            '<td>' + clist[i][3] + '</td><td>' + clist[i][4] + '</td></tr>';
        }
      } else {
        html += '<tr><td colspan="5">データが存在しません</td></tr>';
      }

      html += '</tbody></table>';

      //Googleサーチ
      var card_neme = $cardWindow.find('span.ig_card_name').text();
      var card_no = $cardWindow.find('span.ig_card_cardno').text();
      html += '' +
        '<div style="margin-top: 10px;">' +
          '<form class="gsearch" method="GET" action="http://www.google.co.jp/search"  target="_blank">' +
            '<input type="text" name="q" size="22" value="BushoCard/' + card_no + card_neme + '" />' +
            '<input type="submit" name="btnG" value="Google 検索" />' +
            '<input type="hidden" name="hl" value="ja" />' +
            '<input type="hidden" name="ie" value="UTF-8" />' +
            '<input type="hidden" name="oe" value="UTF-8" />' +
          '</form>' +
        '</div>';

      if (!$cardWindow.find('table[id^="moko_candidate"]').length && name) {
        $cardWindow.append(html);
      } else if (!$cardWindow.find('form.gsearch').length) {
        $cardWindow.append(html);
      }

      adjustTB_window(true);

      return false;
    });
  }
  // カードネームのチェック
  function checkCardName(array, str) {
    var flag = false,
      c = 0;
    for (var i = 0, len = array.length; i < len; i++) {
      if (str == '風魔小太郎' || str == '上杉謙信' || str == '猿飛佐助') {
        continue;
      }
      if (str == array[i]) {
        c++;
      }
    }
    if (c >= 2) {
      flag = true;
    }
    return flag;
  }

  var mekeIdNum = function(id) {
    var array = id.match(/\d+/g),
      id_num = array[0];
    if (array.length > 1) {
      id_num = array[0] + '_' + array[1];
    }
    return id_num;
  },
  valueColor = function(max, value) {
    var color = '';
    if (max === value) {
      color = 'pink';
    } else if (value === 0) {
      color = 'darkGray';
    }
    return color;
  };

