  // 精鋭部隊 一括配置 データ生成
  function elite_bulk() {
    nowLoading();
    var pool_unit = {},
      type;
    $('input[id^="pool_unit_cnt_"]').each(function(idx) {
      if (idx === 0) {
        return true;
      }
      type = $(this).attr('id').match(/\d+/g)[0];
      pool_unit[type] = parseInt($(this).val());
    });

    var list = [],
      set_num = 0,
      id_num, cid, lead_unit, now_unit_cnt, now_type, cname;

    $('input[id^="key_str_array_"]').each(function() {
      id_num = $(this).val();
      cid = $('#card_id_arr_' + id_num).val();
      now_type = $('#unit_id_select_' + id_num).val();
      lead_unit = parseInt($('#lead_unit_' + id_num).text());
      now_unit_cnt = parseInt($('#now_unit_cnt_' + id_num).text());
      cname = $(this).parent().find('a.busho_name').text();

      if ($('#elite_bulk_num').val() == 1) {
        if (!now_type || now_unit_cnt == 1) {
          return true;
        } else {
          set_num = 1;
          pool_unit[now_type] = pool_unit[now_type] + now_unit_cnt - set_num;
        }
      } else {
        if (!now_type || pool_unit[now_type] === 0 || now_unit_cnt == lead_unit) {
          return true;
        } else if (pool_unit[now_type] < lead_unit) {
          set_num = pool_unit[now_type] + now_unit_cnt;
          pool_unit[now_type] = pool_unit[now_type] - set_num;
        } else {
          set_num = lead_unit;
          pool_unit[now_type] = pool_unit[now_type] + now_unit_cnt - set_num;
        }
      }

      if (set_num > 0) {
        list.push({
          card_id: cid,
          unit_type: now_type,
          unit_count: set_num,
          card_name: cname
        });
      }
    });

    if (!list.length) {
      return Info.title('該当カードなし', true);
    } else {
      return sendVirtualArrangement(list, 0);
    }
  }
