  //統率力/攻撃力/防御力/破壊力の算出
  function power_calculation(data) {
    var obj = {
      apt: 0,
      att: 0,
      def: 0,
      des: 0
    };
    if (data.type) {
      var lead1 = LEADERSHIP[data[SOLDIER.mainData[data.type].tp1]];
      var lead2 = LEADERSHIP[data[SOLDIER.mainData[data.type].tp2]];
      var aptitude = (lead1 + lead2) / 2;
      obj.apt = aptitude;
      obj.att = (data.num * SOLDIER.mainData[data.type].attack + data.att) * aptitude;
      obj.def = (data.num * SOLDIER.mainData[data.type].defense + data.def) * aptitude;
      obj.des = parseFloat(SOLDIER.mainData[data.type].destroy * data.num);
    }
    return obj;
  }

  /**
   * 12章
   * 移動時間: ( (3600 * 移動距離 / 2) / 移動速度 ) + 15
   * 12章陣張り
   * 移動時間: ( (3600 * 移動距離 / 3) / 移動速度 ) + 15
   */

  function floatFormat(num, n) {
    var _pow = Math.pow(10, n) ;
    return Math.round(num * _pow) / _pow;
  }
  //移動速度の算出
  function movement_calculation(data) {
    /** data @type {Array} */
    data.sort(function(a, b) {
      return a.move - b.move;
    });
    var slow_type = data[0].type;
    var slow_move = data[0].move;
    var target = slow_type ? SOLDIER.mainData[slow_type].skilltype : slow_type;
    var effect = 0;
    var movement = 0;
    var i, len, key, num;
    for (i = 0, len = data.length; i < len; i++) {
      for (key in data[i].sEffect) {
        if (key.indexOf(target) != -1 || key == '全') {
          effect += data[i].sEffect[key];
        }
      }
      num = slow_move + slow_move * (effect / 100);
      movement = floatFormat(num, 2);  // 小数2桁まで返す
    }
    var sec_per_sq = 3600 / 2 / movement + 15;
    var sps_min = Math.floor(sec_per_sq / 60);
    var sps_sec = Math.floor(sec_per_sq % 60);
    if (sps_min < 10) {
      sps_min = '0' + sps_min;
    }
    if (sps_sec < 10) {
      sps_sec = '0' + sps_sec;
    }
    return {
      num: movement,
      time: sps_min + ':' + sps_sec
    };
  }
  //攻撃力/防御力/破壊力 部隊の合計
  function unit_power_total(array) {
    var attack = 0, defense = 0, destruct = 0;
    var power;
    for (var i = 0, len = array.length; i < len; i++) {
      power = power_calculation(array[i]);
      attack += power.att;
      defense += power.def;
      destruct += power.des;
    }
    return {
      att: attack,
      def: defense,
      des: Math.floor(destruct)
    };
  }
  //兵法上昇率の算出
  function tactics_calculation(array) {
    array.sort(function(a, b) {
      return b.int - a.int;
    });
    var maxNum = array[0],
      n = 0,
      int_rise;
    for (var i = 1, len = array.length; i < len; i++) {
      n += array[i].int;
    }
    int_rise = Math.floor((n / 6 + maxNum.int) / 10);
    int_rise /= 10;
    return int_rise;
  }
