  function getSelectVillage(html, mode) {
    var basename = (mode == 'region') ?
        html.find('#gM01 > ul > li:first > a').text() :
        html.find('#lordSiteArea').text();
    return html.find('#select_village').find('option[label="' + basename + '"]').val() || '';
  }
  //全部隊配置Array生成
  function createTroopsArray(list, name_list, tnum, page, start, t_cost, flg) {
    var deck_cost = get_deck_cost($('#box')),
      num = parseInt($('#radio_box').find('input[name="people"]:checked').val()),
      scg = $('#select_card_group').val(),
      max_page = get_max_page();
    if (start > 4) {
      return allDeckEnd();
    }
    var data = {
      myselect: '',
      ano: start,
      select_card_group: scg,
      select_filter_num: $('#select_filter_num').val(),
      p: page
    };
    $.ajax({
      type: 'post',
      url: location.pathname,
      data: data,
      beforeSend: xrwStatusText
    }).then(function(html) {
      var $html = $(html),
        deck_unit = get_deck_unit($html),
        $img = $html.find('img[alt="解散"]'),
        vid = getSelectVillage($html, $('input[name="mode"]:checked').val());
      if (flg) {
        tnum = tnum;
      } else {
        tnum = tnum - deck_unit.num;
      }
      //行動中・加勢待機 || 配置数クリア
      if ((deck_unit.num > 0 && !$img.length) || deck_unit.num >= num) {
        Info.log('-----');
        tnum = num;
        start++;
        return createTroopsArray(list, name_list, tnum, page, start, t_cost, false);
      }
      //Array
      var $a_btn_gounit = $html.find('a[id^="btn_gounit_"]');
      $a_btn_gounit.each(function() {
        var $cardarea = $(this).closest('div.ig_deck_smallcardarea'),
          data = get_deck_cardarea($cardarea),
          unit_flg = data.btn,
          command = data.num,
          cname = data.name,
          ccost = data.cost;
        if (command === 0 || unit_flg === '0' || ccost === 0) {
          return true;
        } else {
          for (var i = 0, len = name_list.length; i < len; i++) {
            if (name_list[i] == cname) {
              return true;
            }
          }
          if ((deck_cost.free - t_cost) >= ccost && tnum > 0) {
            var array = sQuotesMatch($(this).attr('onClick'));
            var set_assign_id = array[0];
            var set_card_id = array[1];
            list.push({
              vid: vid,
              sid: set_assign_id,
              cid: set_card_id,
              cname: cname
            });
            name_list.push(cname);
            tnum--;
            t_cost = t_cost + ccost;
          }
        }
      });
      if ((deck_cost.free - t_cost) <= 0.5) { //コスト上限
        if (list.length) {
          return captainRegistration('all', list, start, scg, page, t_cost);
        } else {
          return allDeckEnd();
        }
      } else if (tnum > 0 && page === max_page) { //配置枠未達成 && 残りページ無
        Info.title('全部隊配置中...　　' + page + '/' + max_page + 'ページ');
        if (list.length) {
          return captainRegistration('all', list, start, scg, page, t_cost);
        } else {
          return allDeckEnd();
        }
      } else if (tnum > 0 && page <= max_page) { //配置枠未達成 && 残りページ有
        page++;
        Info.title('全部隊配置中...　　' + page + '/' + max_page + 'ページ');
        flg = true;
        return createTroopsArray(list, name_list, tnum, page, start, t_cost, flg);
      } else if (tnum > 0 && page == max_page && list.length || tnum === 0) { //全ページ検索済み && 配置枠未達成(データ有) || 配置枠達成
        Info.title('全部隊配置中...　　' + page + '/' + max_page + 'ページ');
        page = 1;
        return captainRegistration('all', list, start, scg, page, t_cost);
      } else if (page == max_page && !list.length) { //全ページ検索済み && 配置枠未達成(データ無)
        return allDeckEnd();
      }
    });
  }
