  // お気に入り部隊 データ生成
  function favoriteVirtualData(target, scg, deck_status, deck_cost) {
    Info.title('カードの状態をチェックしています...');
    var favorites = scg == 6 ? getStorage({}, 'ixamoko_elite_troops') : getStorage({}, 'ixamoko_favorites_troops');
    for (var key in favorites) {
      //ステータスの取得
      for (var i = 0, len = favorites[key].unit.length; i < len; i++) {
        var data = get_card_data($('#data_box > #cardWindow_' + favorites[key].unit[i].cid));
        if (!data) {
          favorites[key].unit[i].squad = true
        } else {
          favorites[key].unit[i] = data;
        }
      }
    }
    return virtualArrangementList(favorites, target, scg, deck_status, deck_cost);
  }
  // お気に入り部隊 データ取得
    /** cardWindow と pool_unitを持ってくる
     */
  function acquisitionCardData(target, scg, $html, san) {
    nowLoading();
    Info.title('カードデータを取得中...');

    $('#ixamoko_mask, #moko_dialog, #data_box').remove();

    var $data_box = $('<div id="data_box" style="display: none;" />').insertAfter('#sidebar');

    var select_assign_no = san ? san : $html.find('#select_assign_no').val();
    var deck_status = get_deck_status($html, select_assign_no);
    var deck_cost = get_deck_cost($html);
    var collect_meta = function(target, scg, deck_status, deck_cost, page, max_page) {
      if (page > max_page) {
        return favoriteVirtualData(target, scg, deck_status, deck_cost);
      }
      var data = {
        show_num: '100',
        p: page,
        select_card_group: scg,
        select_filter_num: '0'
      };
      $.ajax({
        type: 'post',
        url: '/facility/set_unit_list.php',
        data: data,
        beforeSend: xrwStatusText
      })
      .then(function(html) {
        var $html = $(html).find('#ig_boxInner'),
        max_page = html_max_page($html),
        $cardWindow = $html.find('div[id^="cardWindow_"]');
        $data_box.append($cardWindow);
        page++;
        Info.count(page + '/' + max_page + 'ページ');
        return collect_meta(target, scg, deck_status, deck_cost, page, max_page);
      });
    };

    if (location.pathname == '/map.php') {
      if (!$('#pool_unit_now_').length) {
        var $input = $html.find('#ig_boxInner').children('input[type="hidden"]');
        $('#box').after($input);
      }
    }

    if (!$html.find('ul.pager').length) {
      if (scg == 6) {
        $html.find('input[id^="card_id_arr"]').each(function() {
          if (!$(this).parent('td').hasClass('squad_overlay')) {
            return;
          }
          $html.find('#cardWindow_' + $(this).val()).remove();
        });
      }
      var $cardWindow = $html.find('div[id^="cardWindow_"]');
      $data_box.append($cardWindow);
      return favoriteVirtualData(target, scg, deck_status, deck_cost);
    } else {
      return collect_meta(target, scg, deck_status, deck_cost, 1, 1);
    }
  }
