  // 出品 オートページャー
  function tradeCardAutoPager() {
    var tradeCard_add_page = function(max_page, page, idx) {
      if (!tradeCard_add_page.flag) {
        tradeCard_add_page.flag = true;
      } else if (tradeCard_add_page.flag) {
        return;
      }
      page++;
      idx ++;
      var idx2 = idx + 1;
      var data = {
        show_num: $('select[name="select_show_num"]').val(),
        select_card_group: $('#select_card_group').val(),
        select_filter_num: $('#select_filter_num').val(),
        p: page
      };
      $.ajax({
        type: 'post',
        url: '/card/trade_card.php',
        data: data,
        beforeSend: xrwStatusText
      }).then(function(html) {
        var $subcardarea = $(html).find('div.ig_deck_subcardarea');
        $subcardarea.each(function(i) {
          var x = idx + i;
          var y = idx2 + i;
          tradeAuxiliaryPreparation($(this), x, y);
        });
        $('div.tradelist').append($subcardarea);
        $('ul.pager').data({
          'page': page,
          'idx': idx + $subcardarea.length
        });
        if (max_page == page) {
          return moko_notice('全ページ読み込み完了', true);
        }
        tradeCard_add_page.flag = false;
      }, null);
    },
    pager_num = get_pager_num(),
    max_page = pager_num.max,
    index_page = pager_num.index,
    $pager = pager_num.pager,
    idx = parseInt($('div.ig_deck_subcardarea:last').attr('id').match(/\d+/g)[0]);

    $pager.data({'page': index_page, 'idx': idx });

    $(window).scroll(function() {
      var scroll_bottom = getScrollBottom(),
        index_page = parseInt($pager.data('page')),
        idx = parseInt($pager.data('idx'));
      if (scroll_bottom < 5 &&  index_page < max_page) {
        return tradeCard_add_page(max_page, index_page, idx);
      }
    });
  }
  // 取引 オートページャー
  function tradeAutoPager() {
    if (location.pathname != '/card/trade.php' || !options.trade_auto_pager) {
      return;
    }
    var trade_add_page = function(max_page, page, id_num) {
      if (!trade_add_page.flag) {
        trade_add_page.flag = true;
      } else if (trade_add_page.flag) {
        return;
      }
      page ++;
      var t = $('#t').val(),
        k = encodeURIComponent($('#k').val()),
        s = $('#s').val(),
        o = $('#o').val();
      var href = '/card/trade.php?t=' + t + '&k=' + k + '&s=' + s + '&o=' + o + '&p=' + page;
      $.ajax({
        type: 'post',
        url: href,
        beforeSend: xrwStatusText
      }).then(function(html) {
        var $html = $(html).find('div.ig_decksection_mid'),
          $tr = $html.find('tr').slice(1),
          $cardWindow = $html.find('div[id^="cardWindow_"]'),
          $a = $html.find('a.thickbox'),
          $pager_html = $html.find('ul.pager').html(),
          change_href;
        for (var i = 0, len = $cardWindow.length; i < len; i++) {
          id_num++;
          $cardWindow.eq(i).attr('id', 'cardWindow_' + id_num);
          change_href = $a.eq(i).attr('href').split('cardWindow')[0] + 'cardWindow_' + id_num;
          $a.eq(i).attr('href', change_href);
        }
        create_immediately_trade($html);
        $('#commonWrapperLeft table.mt10 > tbody').append($tr);
        tb_init('a.thickbox');
        $('ul.pager:last').data({
          'page': page,
          'id_num': id_num
        }).html($pager_html);
        trade_add_page.flag = false;
        if (page == max_page) {
          return moko_notice('全ページ読み込み完了', true);
        }
      });
    },
    pager_num = get_pager_num(),
    $pager = pager_num.pager;

    if (!$pager.length) {
      return;
    }

    var max_page = pager_num.max,
      index_page = pager_num.index,
      id_num = $('div[id^="cardWindow_"]:last').attr('id').match(/\d+/g)[0];

    $pager.data({'page': index_page, 'id_num': id_num })
    .css({ 'padding':'10px 10px 5px', 'background-color':'rgba(242, 241, 221, 0.85)' });
    $('div.ig_decksection_innermid').prepend($pager);

    var position_flag = false;
    var targetTop = $('table.common_table1').offset().top;

    $(window).scroll(function() {
      if ($('#TB_window').length) {
        return; //カードウインドウがある時は止める
      }
      var winTop = $(this).scrollTop(),
        cssLeft = ($(this).width() - $('#wrapper_body').width()) / 2 + 35;
      if (winTop >= targetTop && !position_flag) {
        $pager.css({
          'position': 'fixed',
          'top': '0',
          'left': cssLeft + 'px',
          'width': '690px',
          'margin': '0'
        });
        position_flag = true;
      } else if (winTop <= targetTop && position_flag) {
        $pager.css({
          'position': '',
          'top': '',
          'left': '',
          'width': '',
          'margin': ''
        });
        position_flag = false;
      }
      var scroll_bottom = getScrollBottom(),
        index_page = parseInt($pager.data('page')),
        id_num = parseInt($pager.data('id_num'));
      if (scroll_bottom < 5 && index_page < max_page) {
        return trade_add_page(max_page, index_page, id_num);
      }
    });
  }
  // 取引 即落札
  function create_immediately_trade(html) {
    //取引 落札日が翌日の出品をチェック
    var remainingTime = function(target, time) {
      var remain = Date.parse(target.text()) - time;
      if (remain > 86400000) {
        target.css('background-color', 'lightgray');
      }
    },
    //即落札ボタンの配置
    $html = $(html),
    time = new Date().getTime(),
    $no_choose, $td, text, $last;

    $html.find('TR.fs12').each(function() {
      $no_choose = $(this).find('TD.no_choose');
      $td = $(this).find('TD').eq(6);
      text = $td.text();
      $last = $(this).find('TD:last');
      if (text == '---' && !$no_choose.length) {
        $last.find('a').hide();
        $last.append('<INPUT class="immediately" type="button" value="即落札" />');
      } else if (text != '---') {
        remainingTime($td, time);
      }
    });

    $html.find('input.immediately').on('click', function() {
      var $td = $(this).closest('tr').find('td'),
          cno = $td.eq(0).text(),
          cname = $td.eq(1).find('a').text(),
          price = $td.eq(4).text();
      if (!confirm('No.' + cno + '【' + cname + '】\n落札額：銅銭 ' + price + '\n\n落札処理を実行してよろしいですか？')) {
        return;
      }
      //落札処理
      var $parent = $(this).parent();
      $.ajax({
        type: 'post',
        url: $parent.find('a').attr('href'),
        beforeSend: xrwStatusText
      }).then(function(html) {
        var $form = $(html).find('form[name="exec_bid_form"]');
        $.ajax({
          type: 'post',
          url: '/card/trade_bid.php',
          data: {
            exhibit_cid: $form.find('input[name="exhibit_cid"]').val(),
            exhibit_id: $form.find('input[name="exhibit_id"]').val(),
            buy_btn: '落札する'
          },
          beforeSend: xrwStatusText
        }).then(function(html) {
          return $parent.html('<span style="color: red;">落札完了</span>');
        }, null);
      }, null);
    });
  }
