  // 拠点名称変更
  function renameArea(url) {
    var data = {};
    var href = '/user/change/change.php';
    var hash = '#ptop';
    $.post(href).then(function(html) {
      var $table = $(html).find('table.common_table1');
      var $input, new_name, old_name, keys;
      $table.find('a').each(function() {
        $input = $(this).closest('tr').find('input[name^="new_name"]');
        if ($(this).attr('href') == '/land.php?' + url) {
          old_name = $input.val();
          new_name = prompt(old_name, old_name);
          keys = $input.attr('name');
        }
      });
      if (!new_name) {
        return false;
      }
      $table.find('input[name^="new_name"]').each(function() {
        data[$(this).attr('name')] = $(this).val();
      });
      data.comment = $(html).find('textarea.profile_edit').val();
      data[keys] = new_name;
      data.btn_preview = '確認';
      $.post(href + hash, data).then(function(html) {
        delete data.btn_preview;
        data.btn_send = '更新';
        data.ssid = $(html).find('input[name="ssid"]').val();
        $.post(href + hash, data).then(function(html) {
          location.href = location.pathname + location.search;
        });
      });
    });
  }
  // 国移動プルダウンメニュー
  function countryChange() {
    if (location.pathname != '/map.php') {
      return;
    }
    var $otono_name = $('img.otono_name'),
    $change_menu = $('<div id="change_menu" />').css({
      'left': '20px',
      'top': '41px'
    }).appendTo('#MapContentWrap'),
    data = getSelectBaseData(),
    url = '/map.php?x=' + data.x + '&y=' + data.y + '&c=';
    $.each(COUNTRY.numberKey, function(i, o) {
      $change_menu.append('<a href="' + url + i + '">' + o + '</a>');
    });
    $otono_name.on('click', function() {
      if ($('div.new_worldmap_close_btn').length) { return; }
      $change_menu.slideDown('fast');
      $otono_name.css('background-color', '#8F7124');
    }).hover(function() {
      if ($('div.new_worldmap_close_btn').length) { return; }
      $otono_name.css({'cursor': 'pointer', 'background-color': '#8F7124'});
    }, function() {
      $otono_name.removeAttr('style');
    });
    $change_menu.hover(function() {
      $otono_name.css('background-color', '#8F7124');
    }, function() {
      $(this).slideUp('fast');
      $otono_name.removeAttr('style');
    });
  }
  // 部隊行動状況 カラー
  function unitStatusColor(data) {
    var color;
    switch (data) {
      case '待機':
      case '加待':
        color = {
          'background-color': 'darkgreen',
          'color': 'white'
        };
        break;
      case '攻撃':
        color = {
          'background-color': '#c30',
          'color': 'white'
        };
        break;
      case '強襲':
        color = {
          'background-color': 'darkred',
          'color': 'white'
        };
        break;
      case '陣張':
        color = {
          'background-color': 'mediumVioletRed',
          'color': 'white'
        };
        break;
      case '帰還':
        color = {
          'background-color': '#C2C2C2',
          'color': 'black'
        };
        break;
      case '合流':
        color = {
          'background-color': '#069',
          'color': 'white'
        };
        break;
      case '加勢':
        color = {
          'background-color': 'cornflowerblue',
          'color': 'white'
        };
        break;
      case '開拓':
        color = {
          'background-color': 'lawnGreen',
          'color': 'black'
        };
        break;
      case '国移':
        color = {
          'background-color': '#90f',
          'color': 'white'
        };
        break;
      case '探索':
      case '討伐':
        color = {
          'background-color': 'orange',
          'color': 'black'
        };
        break;
      default:
        color = {};
        break;
    }
    return color;
  }
