  // 部隊行動状況 通信
  function mbsTable() {
    //Ajax通信フラグセット
    if (!mapButaiStatus.ajflag) {
      mapButaiStatus.ajflag = true;
    } else if (mapButaiStatus.ajflag) {
      return;
    }
    //Ajax通信・行動状況を取得
    $.ajax({
      type: 'post',
      url: '/facility/unit_status.php',
      cache: false,
      dataType: 'text',
      beforeSend: xrwStatusText
    }).then(function(html) {
      var data = getUnitStatus(html);
      mapButaiStatus.ajflag = false;
      return updateMbsTable(data);
    }, function(XMLHttpRequest, textStatus, errorThrown) {
      mapButaiStatus.ajflag = false;
    });
  }
  // 部隊行動 Timer
  var mbsTimer;
  function mbsCountDown(data, lag_sec) {
    var comp_flag = false;
    var unit = [];
    var start_sec = new Date().getTime(),  //現在時刻 ミリ秒
      day_sec = 24 * 60 * 60 * 1000,    //一日 ミリ秒
      supple = function(t) {
        if (t < 10 && t >= 0) {
          t = '0' + t;
        } else if (t < 0) {
          t = '00';
        }
        return t;
    };
    var target;
    for (var i = 0, len = data.length; i < len; i++) {
      if (!data[i].rest_time) {
        continue;
      }
      var left = data[i].arrival_time - start_sec - lag_sec; //残り時間 ミリ秒
   // var d = supple(Math.floor(left / day_sec));                      //日
      var h = supple(Math.floor((left % day_sec) / (60 * 60 * 1000))); //時
      var m = supple(Math.floor((left % day_sec) / (60 * 1000)) % 60); //分
      var s = supple(Math.floor((left % day_sec) / 1000) % 60 % 60);   //秒
      data[i].count = h + ':' + m + ':' + s;
      if (data[i].count === '00:00:00' && !data[i].stagnates) { // 延滞中はロクを出さない
        comp_flag = true;
        unit.push(data[i].unit_name);
      }
      target = $('#mt_butai span.mt_time:eq(' + i + '), #map_status_table td.rest_time:eq(' + i + ')');
      target.html('(<span class="count_time">' + data[i].count + '</span>)');
    }
    //行動完了
    if (comp_flag) {
      if (!$('#ig_fightlistmenu').length) {
        moko_notice(makeLog('部隊の行動が完了しました', unit, '部隊'));
      }
      clearTimeout(mbsTimer);
      return setTimeout(mbsTable, 300);
    }

    mbsTimer = setTimeout(function() {
      mbsCountDown(data, lag_sec);
    }, 1000);
  }
  // 部隊行動 update
  function updateMbsTable(data) {
    var $mt_butai = $('#mt_butai'),
        select_base = $('#lordSiteArea').text(),
        state_flg = false,
        $mt_troops, $mt_unit, $mt_time;
    //行動状況マークのリセット
    if (location.pathname == '/map.php') {
      var target = $('#ig_mapsAll img.st_icon');
      target.remove();
    }
    for (var i = 0, len = data.length; i < len; i++) {
      //サイドボックスの初期化
      $mt_troops = $mt_butai.find('div.mt_troops').eq(i);
      $mt_unit = $mt_butai.find('div.mt_unit').eq(i).empty();
      $mt_time = $mt_butai.find('span.mt_time').eq(i).empty();
      //テーブルタイプの初期化
      var $tr = $('#map_status_table TBODY > TR').eq(i);
      $tr.find('TD').slice(1).empty().removeAttr('style');
      //imgから、状況と表示カラーの選別
      /*
       * 15章 合流待機画像: mode_merge_attack_ready.png
       */
      if (!data[i].unit_name) {
        if (i < 5) {
          data[i].unit_name = '[編成]';
        } else if (i === 5 || i === 6) {
          data[i].unit_name = '[加勢専用]';
        } else {
          data[i].unit_name = '[強襲専用]';
        }
        data[i].status = '';
        state_flg = false;
        $mt_unit.css({
          'background-color': '#333',
          'color': 'white'
        });
      } else if (!data[i].img_src && data[i].word == '合流詳細') {
        data[i].status = '合流';
        state_flg = true;
        $mt_unit.css(unitStatusColor(data[i].status));
      } else if (!data[i].img_src && data[i].word == '帰還する') {
        data[i].status = '加待';
        state_flg = true;
        $mt_unit.css(unitStatusColor(data[i].status));
      } else if (data[i].img_src.indexOf('mode_wait.png') != -1 || !data[i].img_src) {
        // 合流待機は待機にする
        data[i].status = '待機';
        state_flg = true;
        $mt_unit.css(unitStatusColor(data[i].status));
      } else if (data[i].img_src.indexOf('mode_return.png') != -1) {
        data[i].status = '帰還';
        state_flg = true;
        $mt_unit.css(unitStatusColor(data[i].status));
      } else if (data[i].img_src.indexOf('icon_backup.png') != -1) {
        data[i].status = '加勢';
        state_flg = true;
        $mt_unit.css(unitStatusColor(data[i].status));
      } else if (data[i].img_src.indexOf('mode_develop.png') != -1) {
        data[i].status = '開拓';
        state_flg = true;
        $mt_unit.css(unitStatusColor(data[i].status));
      } else if (data[i].img_src.indexOf('mode_move.png') != -1) {
        data[i].status = '国移';
        state_flg = true;
        $mt_unit.css(unitStatusColor(data[i].status));
      } else if (data[i].img_src.indexOf('icon_dungeon.png') != -1) {
        data[i].status = '探索';
        state_flg = true;
        $mt_unit.css(unitStatusColor(data[i].status));
      } else if (data[i].img_src.indexOf('icon_raidboss.png') != -1) {
        data[i].status = '討伐';
        state_flg = true;
        $mt_unit.css(unitStatusColor(data[i].status));
      } else if (data[i].img_src.indexOf('mode_assault.png') != -1) {
        data[i].status = '強襲';
        state_flg = true;
        $mt_unit.css(unitStatusColor(data[i].status));
      } else if (data[i].img_src.indexOf('mode_attack.png') != -1) {
        if (data[i].mode != '-') {
          data[i].status = '攻撃';
          state_flg = true;
          $mt_unit.css(unitStatusColor(data[i].status));
        } else if (data[i].mode == '-') {
          data[i].status = '陣張';
          state_flg = true;
          $mt_unit.css(unitStatusColor(data[i].status));
        }
      }
      if (state_flg) {
        if (data[i].status == '探索' || data[i].status == '討伐') {
          data[i].desti_html = data[i].desti_text;
        } else {
          if (data[i].status == '待機') {
            data[i].desti_html = data[i].desti_text;
          } else if (select_base != data[i].desti_base) {
            data[i].desti_html = '<a href="' + data[i].desti_href + '" title="' + data[i].desti_base + '">' + data[i].desti_base + '</a>';
          } else {
            data[i].desti_html = '<a href="' + data[i].desti_href + '" title="' + data[i].desti_base + '" style="color: yellow;">' + data[i].desti_base + '</a>';
          }
        }
      }
      if (!data[i].status) {
        $mt_unit.text(data[i].unit_name.replace(/[\[\]]/g, '').trim());
        $mt_troops.attr('coord', '/card/deck.php?ano=' + i);
      } else if (data[i].status == '探索' || data[i].status == '討伐') {
        $mt_unit.text(data[i].unit_name.replace(/[\[\]]/g, '').trim());
      } else {
        $mt_unit.text(data[i].unit_name.replace(/[\[\]]/g, '').trim());
        $mt_troops.attr('coord', data[i].affil_href);
        $mt_troops.attr('url', data[i].desti_href);
      }
      $mt_troops.attr({
        'mode': data[i].status,
        'a_base': data[i].affil_base,
        'd_base': data[i].desti_base
      });
      var side_rest_time = data[i].rest_time;
      if (!data[i].status) {
        side_rest_time = ' ----- ';
      } else if (data[i].status == '待機') {
        side_rest_time = '待機中';
      } else if (data[i].status == '加待') {
        side_rest_time = '加勢待機';
      }
      $mt_time.html('(<span class="count_time">' + side_rest_time + '</span>)');
    }
    // ^loop
    if (options.map_butai_status_mod == 1 && location.pathname == '/map.php') {
      setMapStatusTable(data);
    }
    if (options.map_minimap && $('#mini_map canvas').length) {
      clearRect();
    }
    if (options.all_area_map && $('#allareaMapimg canvas').length) {
      am_cursor_rect();
    }
    if (location.pathname == '/map.php' && options.panel_attack) {
      Map.collectivelyOverlay(getTroopsStatus(), 'st_icon');
    }
    //Timer
    clearTimeout(mbsTimer);
    var timr_text = $('#server_time').text().replace(/-/g, '/'),
      lag_sec = Date.parse(timr_text) - new Date().getTime(); //サーバーとの時間差
    return mbsCountDown(data, lag_sec);
  }
  // 部隊行動 status
  function getUnitStatus(html) {
    var $html = $(html).find('div.ig_decksection_innermid');
    var deck_num = 7; //デッキ数
    var data = [];
    var target;
    var object;
    for (var i = 0; i <= deck_num; i++) {
      target = $html.find('a[href^="/card/deck.php?ano=' + i + '"]').closest('div.ig_fight_statusarea');
      var $table = target.find('table.paneltable'),
        $td_1 = $table.find('tr').eq(1).find('td'),
        $td_2 = $table.find('tr').eq(2).find('td'),
        $affil = $td_2.eq(0).find('a'),
        $desti = $td_2.eq(1).find('a'),
        $desti_base = $td_1.eq(2),
        $count_down = $table.find('span.count_down'),
        $span = $count_down.parent(),
        desti_text = $desti_base.text().trim(),
        unit_name = target.find('h3').text().split('部隊')[0],
        rest_time = $count_down.text(),
        time_text = ($span.text().match(/\d+-\d+-\d+ \d+:\d+:\d+/) || [])[0],
        arrival_time = time_text ? Date.parse(time_text.replace(/-/g, '/')) : '',
        mode = $table.find('tr').eq(0).find('td').eq(2).find('span').text(),
        word = $td_1.eq(1).find('a').text().replace('>','').trim(),  // 加勢待機: div > a || 12章合流: p > a
        img_src = $td_1.eq(1).find('img').attr('src') || '',
        $cancel = $table.find('tr').eq(0).find('img[alt="キャンセル"]').parent(),
        cancel_html = ($cancel.length) ? $cancel[0].outerHTML : '',
        affil_base = '',
        affil_href = '',
        desti_base = '',
        desti_href = '';
      if ($affil.length) {
        affil_base = $affil.text();
        affil_href = $affil.attr('href').replace('land', 'map');
      }
      if ($desti.length) {
        desti_base = $desti.text();
        if (desti_base == '空き地') {
          var code = $desti.parent().text().match(/-?\d+/g).join(',');
          desti_base = desti_base + ' ' + code;
        }
        desti_href = $desti.attr('href').replace('land', 'map');
      }
      if (!target.length) {
        object = {};
      } else {
        object = {};
        object.rest_time = rest_time;
        object.arrival_time = arrival_time;
        object.unit_name = unit_name;
        object.mode = mode;
        object.word = word;
        object.img_src = img_src;
        object.cancel = cancel_html;
        object.affil_base = affil_base;
        object.affil_href = affil_href;
        object.desti_base = desti_base;
        object.desti_href = desti_href;
        object.desti_text = desti_text;
        object.stagnates = rest_time == '00:00:00' ? true : false;  // 処理が延滞中のフラグ
      }
      data.push(object);
    }
    return data;
  }
