  // 陣・出城 LV表示
  function lebelSearch(list) {
    if (!list.length) {
      var re_write = function(nw, nc, ni, nr, nf) {
        $('#nw').html(nw);
        $('#nc').html(nc);
        $('#ni').html(ni);
        $('#nr').html(nr);
        $('#nf').html(nf);
      };
      $('input[id^="cnt_"]').on('change', function() {
        var ths = $(this),
          cnt = ths.attr('id').match(/\d+/g),
          nw = parseInt($('#nw').text()),
          nc = parseInt($('#nc').text()),
          ni = parseInt($('#ni').text()),
          nr = parseInt($('#nr').text()),
          nf = parseInt($('#nf').text()),
          sv = parseInt($('#cnt_' + cnt).attr('value')),
          sf = parseInt($('#cnt_' + cnt).attr('fame'));
        if (ths.prop('checked')) {
          nw -= sv;
          nc -= sv;
          ni -= sv;
          nr -= sv;
          nf -= sf;
        } else {
          nw += sv;
          nc += sv;
          ni += sv;
          nr += sv;
          nf += sf;
        }
        re_write(nw, nc, ni, nr, nf);
        $('#resources').find('td').each(function() {
          var $value = parseInt($(this).text());
          if ($value < 0) {
            nw += sv;
            nc += sv;
            ni += sv;
            nr += sv;
            nf += sf;
            re_write(nw, nc, ni, nr, nf);
            $(this).css('color', 'red');
            ths.prop('checked', false);
            moko_alert('必要資源・名声が不足しています');
          } else {
            $(this).css('color', '');
          }
        });
      });
      return keep_select_base();
    }
    var obj = list.shift();
    $.ajax({
      type: 'post',
      url: obj.url,
      beforeSend: xrwStatusText
    }).then(function(html) {
      var section = $(html).find('div.ig_decksection_top').text(),
        type = section.split(' ')[0],
        lebel_nom = section.match(/\d+/g),
        alart = $(html).find('p.ig_top_alartbox').length,
        lebel = 'LV.' + lebel_nom,
        btnarea = $(html).find('div.ig_tilesection_btnarea'),
        send_url = btnarea.find('a').attr('href'),
        word = ' ' + btnarea.text().trim(),
        resources = ($(html).find('div.icon_wood').text().trim() || 0),
        fame = ($(html).find('table.paneltable td:has(img[alt="名声"])').text().trim() || 0);
      if (type == '出城' && lebel_nom == '4' && alart) {
        word = ' ' + '現在レベルアップ中です';
      }
      obj.ins.html(lebel + word);
      if (word == ' ') {
        obj.ins.append(' <label><input type="checkbox" id="cnt_' + obj.idx + '" url="' + send_url + '" value="' + resources + '" fame="' + fame + '"/>レベルアップ</label>');
      }
      lebelSearch(list);
    }, null);
  }
  //座標記録 城主プロフィール・敵襲状況
  function coordinateRecord() {
    if (!options.map_reg) {
      return;
    }
    if (location.pathname != '/user/' && location.pathname != '/user/index.php' && location.pathname != '/war/fight_history.php') {
      return;
    }
    var map_list = getStorage({}, 'ixamoko_map_list'),
      coordinate_openmenu = function(target, e) {
        var $tooltip = display_tooltip(e.pageX, e.pageY, 20).empty();
        var map_list = getStorage({}, 'ixamoko_map_list'),
          $a, base_name, coord;
        if (location.pathname == '/user/' || location.pathname == '/user/index.php') {
          $a = target.find('a');
          base_name = $a.eq(0).text().trim();
          coord = $a.eq(1).attr('href').split('?')[1];
        } else if (location.pathname == '/war/fight_history.php') {
          $a = target.find('td').eq(3).find('a');
          base_name = $a.text().split('　(')[0];
          coord = $a.attr('href').split('?')[1];
        }
        $('<li id="selection_tile">' + base_name + '</li>').appendTo($tooltip);
        if (map_list[coord]) {
          $('<li id="reg_map" coord="' + coord + '">座標削除</li>').on('click', function() {
            General.coordDelete($(this).attr('coord'), $('#selection_tile').text());
            General.recordedMark();
          }).appendTo($tooltip);
        } else {
          $('<li id="reg_map" coord="' + coord + '">座標記録</li>').on('click', function() {
            General.coordRecord($(this).attr('coord'), $('#selection_tile').text());
            General.recordedMark();
          }).appendTo($tooltip);
        }
        $('#reg_map').on('click', function() {
          $tooltip.hide();
        });
        return processing_tooltip($tooltip, e);
      },
      openMenu = function(e, obj) {
        if (e.target.tagName == 'TH' || e.target.tagName == 'A') {
          return;
        }
        coordinate_openmenu(obj, e);
      },
      target;

    if (location.pathname == '/user/' || location.pathname == '/user/index.php') {
      target = $('table.common_table1 tr.fs14');
      target.find('a:eq(1)').each(function() {
        $(this).attr('href', $(this).attr('href').replace('land', 'map'));
      });
      General.recordedMark();
      target.on('contextmenu', function(e) {
        e.preventDefault();
        return openMenu(e, $(this));
      });
    } else if (location.pathname == '/war/fight_history.php') {
      target = $('table.ig_battle_table tbody tr').slice(1);
      target.find('td:eq(3) a').each(function() {
        var source = $(this).text().split('　('),
          base_name = source[0],
          code_num = source[1].match(/-?\d+/g),
          country_code = getCountryCode(),
          coord = '/map.php?x=' + code_num[0] + '&y=' + code_num[1] + '&c=' + country_code[1];
        $(this).attr('href', coord);
      });
      General.recordedMark();
      target.on('contextmenu', function(e) {
        e.preventDefault();
        return openMenu(e, $(this));
      });
    }
  }

