  // 広域マップ データ取得
  function storeAlliesBase(flag) {
    if (!options.all_area_map || location.pathname != '/alliance/info.php') {
      return;
    }

    var $tr = $('table.common_table1 tr.fs12').not('.now, sub'); //自分は除く 14章の合戦内政ポイントの行は除外
    if (!$tr.length) {
      return;
    }

    var btn = $('<button id="store_allies_base">同盟員の拠点を記録</button>')
      .click(createAllianceObj);

    btn.css({
      'height': 'auto',
      'width': 'auto',
      'margin': '0 0 0 10px',
      'vertical-align': 'bottom'
    })
    .insertAfter($('img[alt="同盟情報"]').eq(1));

    function createAllianceObj() {
      if (!confirm('同盟員の拠点を取得します。100人規模で約1分かかります。よろしいですか?')) {
        return;
      }
      if (!flag) {
        flag = true;
      } else if (flag) {
        return;
      }
      nowLoading();
      var target = $tr.find('a:eq(1)');
      var code = $('<p>&#8233;</p>').text();
      var al_name = $('dl.alliance_nickname dd').text().replace(code, '', 'g');
      var al_id = $('div.tab_alliance_info a').attr('href').match(/\d+/g)[0];
      var family = $('div.country_name').text().trim().split('　全国')[0];

      var memberData = {};
      var allianceObj = getStorage({}, 'ixamoko_areamap_data');
      if (!allianceObj[family]) {
        allianceObj[family] = {
          '国番号': COUNTRY.nameKey[family],
          '同盟ID': {}
        };
      }
      allianceObj[family]['同盟ID'][al_id] = {
        '名称': al_name,
        '同盟員': memberData,
        '戦場': '',
        'date': Date()
      };

      function getMemberData(i) {
        var name = target.eq(i).text();
        var url = target.eq(i).attr('href');
        var len = target.length;
        Info.title('同盟員の拠点を取得中...');
        Info.count((i + 1) + '/' + len + '人目');
        $.ajax({
          url: url,
          cache: true,
          async: false,
          beforeSend: xrwStatusText
        }).then(function(html) {
          var $html = $(html).find('#ig_mainareaboxInner'),
              $tr = $html.find('table.common_table1').find('tr.fs14');
          memberData[name] = {
            'ポスト': $html.find('div.pro5 p.para').text().trim(),
            '拠点': {'本領': {}, '所領': {}, '開拓地': {}, '領地': {}, '陣': {}, '出城': {}}
          };
          $tr.each(function() {
            var text = $(this).find('td').eq(0).text();
            var type = (text == '同盟陣') ? '陣' : text;  // 種類
            var $a = $(this).find('a').eq(0);
            var base_name = $a.text().replace(code, '', 'g').trim(); // 拠点名称
            var href = $a.attr('href').replace('land', 'map');  // URL
            var country = href.match(/\d+/g)[2]; // 国番号
            var coord = $(this).find('a').eq(1).text(); // 座標
            var num = $(this).find('td').eq(3).text();
            var popul = num.match(/\d+/g) ? num : '-'; // 人口
            var status = '-';
            if (type == '出城' || type == '陣') {
              allianceObj[family]['同盟ID'][al_id]['戦場'] = country;
            }
            // 追加 2017/10/10 {
            var td_4 = $tr.find('td').eq(4).text();
            var c_def = td_4.indexOf('連続防衛') != -1 ? td_4.match(/\d+/g)[0] : ''; // 連続防衛
            memberData[name]['拠点'][type][base_name] = [coord, popul, status, href, c_def];
            // }
            // memberData[name]['拠点'][type][base_name] = [coord, popul, status, href];
          });
          if (++i < len) {
            //再帰ループ処理
            setTimeout(getMemberData, 300, i);
          } else {
            intvl2(false);
          }
        }, null);
      }
      // 陥落チェック
      function intvl2(flag) {
        if (!confirm('陥落チェックを行いますか？100人規模で約6分かかります。')) {
          nowLoading(true);
          setStorage('ixamoko_areamap_data', allianceObj);
          return;
        }
        if (!flag) {
          flag = true;
        } else if (flag) {
          return;
        }
        var array = extractObject();  // 対象を抽出
        return fallCheck(array, 1, array.length);
      }

      function extractObject() {
        var array = [],
            key, key2, key3, key4, code;
        for (key in memberData) {
          for (key2 in memberData[key]) {
            for (key3 in memberData[key][key2]) {
              if (!key3.match(/本領|所領|出城/)) {
                continue;
              }
              for (key4 in memberData[key][key2][key3]) {
                code = memberData[key][key2][key3][key4][3].match(/(-?\d+)/g);
                array.push({
                  x: code[0],
                  y: code[1],
                  c: code[2],
                  keys: [key, key2, key3, key4]
                });
              }
            }
          }
        }
        return array;
      }
      // チェック実行
      function fallCheck(array, i, len) {
        Info.title('同盟員の陥落拠点を確認中...');
        Info.count(i + '/' + len + '箇所');
        var param = array.shift();
        var json = null;
        $.ajax({
          url: '/map.php',
          type: 'get',
          dataType: 'JSON',
          data: {
            type: 1,
            x: param.x,
            y: param.y,
            c: param.c
          }
        })
        .then(function(data) {
          json = (function() {
            var o;
            for (var key in data) {
              if (data[key].x == param.x && data[key].y == param.y) {
                o = data[key];
                break;
              }
            }
            return o;
          }());
          if (json.fall_flg === '1') {
            var keys = param.keys;
            memberData[keys[0]][keys[1]][keys[2]][keys[3]][2] = '陥落中';
          }
          if (!array.length) {
            setStorage('ixamoko_areamap_data', allianceObj);
            nowLoading(true);
          } else {
            i++;
            setTimeout(fallCheck, 300, array, i, len);
          }
        }, null);
      }
      // 実行
      getMemberData(0);
    }
  }
