  // 格付 盟主サマリー
  function leaderInformationSummary() {
    if (!options.warskil_summary_init || location.pathname != '/alliance/list.php') {
      return;
    }
    if (!$('div.ig_decksection_top').text().match(/国別格付 同盟/)) {
      return;
    }
    var $a, source, search, max_page;
    $a = $('ul.pager').find('a:last');
    source = $a.attr('href');
    search = source.replace(/&p=\d+/, '');
    max_page = parseInt(source.match(/\d+/g)[1]);
    $('<input type="button" value="サマリー[盟主情報]" />').css('margin-left', '20px').on('click', function() {
      nowLoading();
      Info.title('情報を取得中...');
      return leaderListSearch(search, max_page, 0, 1, '');
    }).insertAfter('p.submenu');

    function leaderListSearch(search, max_page, num, page, data_list) {
      var url = search + '&p=' + page;
      var c = 0;
      $.ajax({
        type: 'post',
        url: url,
        beforeSend: xrwStatusText
      })
      .then(function(html) {
        var $fs = $(html).find('tr.fs12'),
        text = $fs.find('td').eq(0).text(),
        len = $fs.length,
        $tr = $fs.eq(num);
        $fs.each(function() {
          var _text = $(this).find('td').eq(0).text();
          if (text == _text) {
            c++;
          }
        });
        //1ページ同ランクなら以下も同じなので、30位に満たなくても終了する
        if (len == c) {
          Info.title('以降同順位の為、終了します');
          return setTimeout(leaderUserSearch, 2000, '', search, max_page, num, page, data_list, len, true);
        }
        var list = [];
        $tr.each(function() {
          var text = $(this).find('td').eq(0).text(),
          rank, rank_num;
          if (text == '筆頭') {
            rank = text;
            rank_num = 1;
          } else {
            rank = text;
            rank_num = parseInt(text);
          }
          var $aa = $(this).find('a').eq(1),
          $na = $(this).find('a').eq(2),
          alliance = $aa.text(),
          a_href = $aa.attr('href'),
          name = $na.text(),
          n_href = $na.attr('href'),
          comrade = $(this).find('td').eq(3).text(),
          stars = $(this).find('td').eq(4).text();
          list.push(rank, name, n_href, alliance, a_href, comrade, stars, rank_num);
        });
        leaderUserSearch(list, search, max_page, num, page, data_list, len, false);
      }, null);
    }

    function leaderUserSearch(list, search, max_page, num, page, data_list, len, flag) {
      var limit = 30;
      Info.count(list[7] + '/' + limit + '位');
      if (list[7] > limit || list[7] > max_page || page > max_page || flag) {
        showLeaderSummary(data_list);
        nowLoading(true);
        return false;
      }
      $.ajax({
        type: 'post',
        url: list[2],
        beforeSend: xrwStatusText
      }).then(function(html) {
        var $a = $(html).find('tr.fs14').eq(0).find('a').eq(1);
        var source = $a.text();
        var href = $a.attr('href').replace('land', 'map');
        var cord = source.split(',');
        var x = parseInt(cord[0]);
        var y = parseInt(cord[1]);
        var area;
        if (y < 0) {
          area = "南";
        } else {
          area = "北";
        }
        if (x < 0) {
          area += "西";
        } else {
          area += "東";
        }
        var code = href.match(/(-?\d+)/g),
        obj = {
          x: code[0],
          y: code[1],
          c: code[2]
        },
        data = getMapTargetData(obj, 1),
        state;
        if (data.fall_flg !== '0') {
          state = '<span style="color: #c00;">陥落中</span>';
        } else {
          state = '-';
        }
        var tmp = '<tr>' +
        '<td>' + area + '</td>' +
        '<td><a href="' + href + '" target="_blank">' + source + '</a></td>' +
        '<td><a href="' + list[2] + '" target="_blank">' + list[1] + '</a></td>' +
        '<td>' + state + '</td>' + '<td>' + list[0] + '</td>' +
        '<td><a href="' + list[4] + '" target="_blank">' + list[3] + '</a></td>' +
        '<td style="text-align: right;">' + list[5] + '</td>' +
        '<td style="text-align: right;">' + list[6] + '</td>' +
        '</tr>';
        data_list += tmp;
        if (num == (len - 1)) {
          num = 0;
          page++;
        } else {
          num++;
        }
        return leaderListSearch(search, max_page, num, page, data_list);
      }, null);
    }

    function showLeaderSummary(data_list) {
      var html = '' +
        '<table id="summary" width="700" class="common_table1 center mt10">' +
        '<thead>' +
        '<th>方角</th><th>座標</th><th>盟主</th><th>状態</th>' +
        '<th>順位</th><th>同盟</th><th>同志</th><th>戦功</th>' +
        '</thead>' +
        '<tbody>' + data_list + '</tbody>' +
        '</table>';
      $('div.common_box3bottom').empty().append(html);
      var area_color = {
        '北東': 'lightblue',
        '北西': 'lightsteelblue',
        '南東': 'burlywood',
        '南西': 'darksalmon'
      },
      $tbody = $('#summary tbody');

      $tbody.find('tr').each(function() {
        $(this).find('td').eq(0).css('background-color', area_color[$(this).find('td').eq(0).text()]);
      });
      $tbody.html(
        $('#summary > tbody').find('tr').sort(function(a, b) {
          if ($(a).text() > $(b).text()) {
            return 1;
          } else {
            return -1;
          }
        })
      );
    }
  }
