  // 合戦報告書 リスト 城主スキル発動サマリー
  function castleSkillsSummary() {
    if (!options.warskil_summary_init || location.pathname != '/war/list.php') {
      return;
    }
    if ($('select[name="name"]').val() != 'lord') {
      return;
    }
    var $ws_summary = $('<input type="button" id="ws_summary" value="サマリー[スキル発動]" />')
      .css('margin-left', '30px')
      .appendTo('#ig_battle_report_sort');

    if (!$('div.ig_battle_report_text').length) {
      $ws_summary.prop('disabled', true);
    }
    $ws_summary.on('click', function() {
      nowLoading();
      Info.title('サマリーを作成中...');
      var tmp = location.search.match(/word=([^&]+)/i);
      if (!tmp) {
        nowLoading(true);
        moko_alert("対象城主名が取得できません");
        return false;
      }
      var author = decodeURIComponent(tmp[1]);
      if (!author) {
        nowLoading(true);
        moko_alert("対象城主名が取得できませんでした");
        return false;
      }
      var data = {
        list: [],
        page: [],
        summary: {},
        author: '【' + author + '】',
        index: 1
      };
      var str = location.pathname + location.search,
          source = str.replace('-', '%2d'),
          search = source.replace(/&p=\d+/g, '');
      var $ul = $('div.ig_battle_pagelist ul'),
          $last = $ul.find('a[title="last page"]'),
          $span = $ul.find('span'),
          max_page = 1;
      if ($last.length) {
        max_page = parseInt($last.attr('href').split('&p=')[1]);
      } else if ($span.length) {
        max_page = parseInt($span.text());
      }
      for (var j = 1; j <= max_page; j++) {
        data.list.push(search + '&p=' + j);
      }
      data.max = max_page;
      return warSkillSearch(data);
    });

    function warSkillSearch(data) {
      if (data.index > data.max) {
        return warSkillView(data);
      }
      $.ajax({
        type: 'post',
        url: data.list[data.index - 1],
        beforeSend: xrwStatusText
      }).then(function(html) {
        var $a = $(html).find('#ig_battle_report_mid div.ig_battle_report_text a');
        $a.each(function() {
          data.page.push($(this).attr('href'));
        });
        return warSkillPage(data);
      }, null);
    }

    function warSkillPage(data) {
      if (!data.page.length) {
        data.index++;
        return warSkillSearch(data);
      }
      Info.count(data.page.length + '　' + data.index + '/' + data.max + 'ページ');
      $.ajax({
        type: 'post',
        url: data.page.shift(),
        beforeSend: xrwStatusText
      }).then(function(html) {
        var array, key, value, i ,len;
        var img = [];
        array = (function() {
          var a = [];
          $(html).find('table.battle_box_info_table tr').each(function(idx) {
            if ($(this).find('th.attack').length) {
              return;
            }
            if ($(this).text().indexOf('発動武将スキル') != -1) {
              return;
            }
            if ($(this).text().indexOf('発動部隊スキル') != -1) {
              // 部隊スキルは取得しない
              return false;
            }
            var str_idx;
            var img_idx;
            $(this).find('td').each(function() {
              if ($(this).text().indexOf(data.author) != -1) {
                str_idx = $(this).index();
                img_idx = str_idx === 1 ? 0 : 3;
              }
            });
            if (str_idx) {
              a.push($(this).find('td').eq(str_idx).text().split('を発動させ')[0].trim());
              img.push($(this).find('td').eq(img_idx).children('img').prop('outerHTML'));
            }
          });
          return a;
        }());
        var card_num;
        for (i = 0, len = array.length; i < len; i++) {
          if (array[i].indexOf(data.author) == -1 || array[i].match(/】部隊が、【/)) {
            continue;
          }
          // 同名カードの識別対応
          card_num = $(img[i]).attr('src') ? $(img[i]).attr('src').match(/\d+/g)[2] : '0000';
          key = card_num + '/' + array[i].replace(/^[\s\S]*】の【/, '').split('】が、')[0];
          value = array[i].match(/【.+?\】/g)[2];
          if (!data.summary[key]) {
            data.summary[key] = {
              str: value,
              img: img[i] || ''
            };
          } else if (!data.summary[key].str.match(value)) {
            data.summary[key].str += ', ' + value;
          }
        }
        return warSkillPage(data);
      }, null);
    }

    function warSkillView(data) {
      var html = '' +
        '<table id="skill_table" class="ig_battle_table">' +
          '<tr><th width="150">武将名</th><th>発動スキル<div id="summary_close" class="mk_cross_mark close" /></th></tr>';
      var line = '', value, img;
      for (var key in data.summary) {
        value = arrayUnique(data.summary[key].str.split(', ')).join(', ');
        img = data.summary[key].img;
        line += '' +
          '<tr>' +
            '<td style="padding: 0; text-align: left;">' +
              img +
              '<span style="padding: 0 6px; font-weight: bold;' + (img ? '' : ' font-size: 14px;') + '">' + key.split('/')[1] + '</span>' +
            '</td>' +
            '<td style="text-align: left;">' + value + '</td>' +
          '</tr>';
      }
      if (!line) {
        line += '<tr><td colspan="2">発動スキルはありません</td></tr>';
      }
      html += line + '</table>';
      var $table = $(html).insertAfter('#war_search');
      var $ws_summary = $('#ws_summary').prop('disabled', true);
      $('#summary_close').on('click', function() {
        $table.remove();
        $ws_summary.prop('disabled', false);
      });
      return nowLoading(true);
    }
  }
  // 合戦報告書 詳細
  function warDetailNavi() {
    if (location.pathname != '/war/detail.php') {
      return;
    }
    // layout
    warReportLayout();
    // 上部に戻るリンク
    createDetailNavi($('#ig_battle_report_mid'));

    var report_id = location.search.substr(1, location.search.length - 1).split("&")[0],
      back_query = $('a[href^="list.php"]').attr('href'),
      plane = 'list.php?m=&p=&s=&name=&word=&coord=&x=&y=&t=',
      return_href;

    if (back_query != plane) {
      //「+」エンコード
      if (back_query.indexOf(' ') != -1) {
        back_query = back_query.replace(/ /g, encodeURIComponent('+')).replace(/\u2028|\u2029/g, '');
      }
      return_href = $('a[href^="list.php?m="]').attr('href');
      if (return_href.indexOf(' ') != -1) {
        return_href = return_href.replace(/ /g, encodeURIComponent('+')).replace(/\u2028|\u2029/g, '');
        $('a[href^="list.php?m="]').attr('href', return_href);
      }
    }

    $.post('/war/' + back_query).then(function(html) {
      var $html = $(html).find('#ig_battle_report_mid');
      var $a = $html.find('A[href^="detail.php"]');
      var $li = $html.find('div.ig_battle_pagelist ul li:has(span)');
      var data = {};
      var last_idx = $a.length - 1;

      $a.each(function(idx) {
        if ($(this).attr('href').indexOf(report_id) != -1) {
          data.prev = idx === 0 ?  '' : $a.eq(idx - 1).attr('href');
          data.next = idx === last_idx ?  '' : $a.eq(idx + 1).attr('href');
        }
      });

      if ($li.length) {
        var search;
        if (!data.prev) {
          search = $li.prev().children('a').attr('href') || '';
        } else if (!data.next) {
          search = $li.next().children('a').attr('href') || '';
        }
        data.search = search;
      }

      if (data.search) {
        $.post(data.search).then(function(html) {
          var $a = $(html).find('#ig_battle_report_mid A[href^="detail.php"]');
          if (!data.prev) {
            data.prev = $a.last().attr('href');
          } else if (!data.next) {
            data.next = $a.first().attr('href');
          }
          return createNavi(data);
        });
      } else {
        return createNavi(data);
      }
    });

    function createNavi(data) {
      var html = '<div class="report_navi clearfix">';
      if (!data.next) {
        html += '<div class="leftG" />';
      } else {
        html += '<div class="leftF"><a href="' + data.next + '">前の報告書へ</a></div>';
      }
      if (!data.prev) {
        html += '<div class="rightG" />';
      } else {
        html += '<div class="rightF"><a href="' + data.prev + '">次の報告書へ</a></div>';
      }
      html += '</div>';
      $('#detail_navi').append(html);

      //キーバインド 合戦報告書(一覧)
      if (options.keybind) {
        var before = $('#detail_navi .leftF > a').attr('href');
        var next = $('#detail_navi .rightF > a').attr('href');
        shortcut.add('w', function() {
          $('img[alt="戻る"]').click();
        }, {
          'disable_in_input': true,
          'keycode': 87
        });
        shortcut.add('a', function() {
          if (before) {
            location.href = before;
          }
        }, {
          'disable_in_input': true,
          'keycode': 65
        });
        shortcut.add('d', function() {
          if (next) {
            location.href = next;
          }
        }, {
          'disable_in_input': true,
          'keycode': 68
        });
      }
    }
  }
