  // 白くじのプライス
  function whitePrice() {
    return 200;
  }
  // 白くじ引き可能数の計算
  function shirokuji_possible_num(html) {
    var $html = $(html),
    source = $html.find('p.l_cardstock').text().match(/\d+/g),
    max = parseInt(source[1]),
    now = parseInt(source[0]),
    card_limit = max - now,
    coin = parseInt($html.find('span.money_b').text()),
    coin_limit = Math.floor(coin / whitePrice());
    return Math.min(card_limit, coin_limit);
  }
  // 合成 白くじ引き ボタンupdate
  function btnImgeUpdate() {
    var mode = $('#union_type').val();
    if (mode != 1 && mode != 4) {
      return;
    }
    var $moko_senkuji_container = $('#moko_senkuji_container'),
    max_num = $moko_senkuji_container.attr('max_num'),
    send_num = $moko_senkuji_container.attr('send_num'),
    $run_send_one = $('#run_send_one'),
    $run_send_plural = $('#run_send_plural'),
    $send_one = $('#send_one'),
    $send_plural = $('#send_plural'),
    set_material = $('div.common_box1bottom').find('a.thickbox'),
    new_send_num = parseInt($send_plural.text());
    var updateSendNum = function(new_send_num) {
      if (new_send_num === 0) {
        $send_one.text(new_send_num);
      } else if (new_send_num === 1) {
        $send_one.text(new_send_num);
        $run_send_one.css('visibility', 'visible');
        $run_send_plural.css('visibility', 'hidden');
      } else if (new_send_num === 2) {
        $run_send_plural.css('visibility', 'visible');
      }
      return $send_plural.text(new_send_num);
    },
    rankupRemoveUpdate = function() {
      $('input[name="button"]').off('click').on('click', function() {
        syntheticWhiteLottery();
      });
    };
    rankupRemoveUpdate();
    $('div.card_set_btn_img').off('click').on('click', function() {
      var nm = max_num - $('div.common_box1bottom').find('a.thickbox').length;
      if (nm < new_send_num) {
        new_send_num--;
      }
      if (new_send_num < 0) {
        new_send_num = 0;
      }
      rankupRemoveUpdate();
      return updateSendNum(new_send_num);
    });
    $('a.material_remove, div.card_unset_btn_img').off('click').on('click', function() {
      var nm = max_num - $('div.common_box1bottom').find('a.thickbox').length;
      if (nm <= send_num) {
        new_send_num++;
      }
      if (new_send_num > max_num) {
        new_send_num = max_num;
      }
      return updateSendNum(new_send_num);
    });
  }
  // 白くじ10枚引き
  function senkujiWhiteLottery() {
    if (location.pathname != '/senkuji/senkuji.php') {
      return;
    }
    var possible_num = shirokuji_possible_num($('#ig_boxInner')),
      capa = Math.min(10, possible_num);
    if (capa === 0) {
      return $('#white').remove();
    }
    $('span.money_b_txt').html('銅銭　' + whitePrice() + '　<a href="javascript:void(0);" id="white" style="color: greenyellow;">' + capa + '枚引き</a>');
    senkujiWhiteLottery.flag = false;
    $('#white').on('click', function(e) {
      if (senkujiWhiteLottery.flag) {
        return;
      }
      e.preventDefault();
      $('#moko_dialog').remove();
      if (!confirm('戦国くじ(白)を' + capa + '枚引いてよろしいですか？')) {
        return;
      }
      senkujiWhiteLottery.flag = true;
      var data = {
        send: 'send',
        got_type: '0',
        sub_id: '0',
        senkuji_token: $('input[name="senkuji_token"]').val()
      };
      var dialog = mokoDialog({
        title: '白くじの結果',
        width: 340,
        height: 340,
        button: true,
        load: false
      });
      displayDialog(dialog);
      return postSenkuji(data, capa, 1);
    });

    function postSenkuji(data, capa, count) {
      if (capa < count) {
        senkujiWhiteLottery.flag = false;
        return;
      }
      $.ajax({
        type: 'post',
        url: '/senkuji/senkuji.php',
        data: data,
        beforeSend: xrwStatusText
      }).then(function(html) {
        var stock_text = $(html).find('p.l_cardstock').text(),
          $card_front = $(html).find('#id_deck_card_front'),
          card_name = $card_front.find('span.ig_card_name').text(),
          rare_icon = $card_front.find('span[class^="rarity_"]').attr('class'),
          tmpl = '<span class="kuji_icon ' + rare_icon + '" /><strong class="kuji_name">' + card_name + '</strong> を引き当てました';
        msgInfo.log(tmpl);
        msgInfo.count('合計' + count + '枚');
        if (capa == count) {
          var cardstock = $('p.l_cardstock'),
            money = $('span.money_b'),
            rema_money = parseInt(money.text()) - capa * whitePrice(),
            new_capa = parseInt($('#white').text());
          //残り枚数と銅銭を書き換え
          cardstock.text(stock_text);
          money.text(rema_money);
          //初期化
          senkujiWhiteLottery();
          return playSound(SOUND.notice);
        } else {
          count++;
          return postSenkuji(data, capa, count);
        }
      }, null);
    }
  }
  // 戦国くじ履歴集計
  function senkujiSummary() {
    if (location.pathname != '/senkuji/senkuji_history.php') {
      return;
    }
    $('table.common_table1 th:last').empty().append('<input type="button" id="aggregate" value="戦国くじ履歴集計" />');
    $('#aggregate').on('click', function() {
      nowLoading();
      Info.title('履歴を集計中...');
      $(this).prop('disabled', true);
      return getSenkujiHistory({}, 1);
    });

    function getSenkujiHistory(object, i) {
      var max_page = 1;
      if ($('ul.pager').length) {
        max_page = $('ul.pager a:last').attr('href').match(/\d+/g)[0];
      }
      if (i > max_page) {
        for (var key in object) {
          var total = 0;
          for (var key2 in object[key]) {
            total += object[key][key2];
          }
          object[key]['合計'] = total;
        }
        return writeSenkujiSummary(object);
      }
      Info.count(i + '/' + max_page + 'ページ');
      $.ajax({
        type: 'post',
        url: '/senkuji/senkuji_history.php?p=' + i,
        beforeSend: xrwStatusText
      }).then(function(html) {
        var $html = $(html).find('#ig_deckboxInner'),
          $tr = $html.find('tr.fs12');
        $tr.each(function() {
          var type = $(this).find('td:last').text(),
            rare = $(this).find('img').attr('alt');
          if (!object[type]) {
            object[type] = {};
            object[type][rare] = 1;
            return;
          }
          for (var key in object) {
            if (key == type) {
              for (var key2 in object[type]) {
                if (key2 == rare) {
                  object[type][key2] += 1;
                } else if (!object[type][rare]) {
                  object[type][rare] = 1;
                }
              }
            }
          }
        });
        i++;
        getSenkujiHistory(object, i);
      }, null);
    }

    function writeSenkujiSummary(object) {
      var array = [],
        keys;
      for (var key in object) {
        keys = object[key];
        keys.type = key;
        array.push(keys);
      }
      array.sort(function(a, b) {
        return b.合計 - a.合計;
      });
      var rare_icon = {
          '序': '/img/card/icon/icon_jo.png',
          '上': '/img/card/icon/icon_jou.png',
          '特': '/img/card/icon/icon_toku.png',
          '極': '/img/card/icon/icon_goku.png',
          '天': '/img/card/icon/icon_ten.png',
          '雅': '/img/card/icon/miyabi.png',
          '童': '/img/card/icon/icon_warabe.png',
          '化': '/img/card/icon/icon_bake.png'
        },
        h = ['序', '上', '特', '極', '天', '雅', '童', '化', '合計'];
      var html = '<table id="agg_table" class="common_table1 center mt10">' + '<tbody>' + '<tr>' + '<th>種類/レアリティ</th>';
      $.each(rare_icon, function(i, s) {
        html += '<th><img src="' + s + '" alt="' + i + '" width="30" height="30" class="middle" /></th>';
      });
      html += '<th>小計</th>' + '</tr>';
      var i, len;
      for (i = 0, len = array.length; i < len; i++) {
        html += '<tr>' + '<td>' + array[i].type + '</td>';
        for (var j = 0, jlen = h.length; j < jlen; j++) {
          html += '<td>' + (array[i][h[j]] ? array[i][h[j]] : 0) + '</td>';
        }
        html += '</tr>';
      }
      html += '</tbody>' + '</table>';
      $('div.ig_tilesection_innermid').prepend(html);
      var list = ['', 0, 0, 0, 0, 0, 0, 0, 0, 0],
        rate = [],
        $tr = $('#agg_table tr').slice(1);
      $tr.each(function() {
        for (i = 1, len = list.length; i < len; i++) {
          var x = parseInt($(this).find('td').eq(i).text());
          list[i] += x;
        }
      });
      var total = list[9],
        num, html2 = '';
      for (i = 0, len = list.length; i < len; i++) {
        num = list[i] / total * 1000 / 10;
        rate.push(num.toFixed(2));
      }
      rate.pop();
      html2 += '<tr><th>合計</th>';
      for (i = 1, len = list.length; i < len; i++) {
        html2 += '<th>' + list[i] + '</th>';
      }
      html2 += '</tr>';
      html2 += '<tr><td>確率</td>';
      for (i = 1, len = rate.length; i < len; i++) {
        if (rate[i] === 0) {
          html2 += '<td>-</td>';
        } else {
          html2 += '<td>' + rate[i] + '%</td>';
        }
      }
      html2 += '<td>-</td></tr>';
      $('#agg_table tbody').append(html2);
      Info.title('集計完了', true);
    }
  }
  
  function _remove_skills() {
    var remove_skills = [];//["槍隊進撃","槍隊堅守","槍隊襲撃"];
    var material = [];
    var card_id_list = [];
    var skill_list =  {};
    var i = 1;
    allAutoPager();

    $('.remove_skill').each(function() {
      remove_skills.push($(this).val());
    });
    setStorage("remove_skills", remove_skills);
    $('div.union_material').each(function() {
      card_id_list.push($(this).attr('data-card_id'));
    });
    for(card_id of card_id_list){
      var skills = [];
      $(`tr#card_data_${card_id}`).find('div.skill_name').each(function() {
        skills.push($(this).text());
      });
      skill_list[card_id] = skills;
    }
    var removeNum = 0;
    for(card_id in skill_list){
      var skills = skill_list[card_id];
      for(skill of skills){
        if(remove_skills.indexOf(skill) >= 0){
          $removeBtn = $(`div[data-card_id="${card_id}"]`).find('a.material_remove');
          $removeBtn.click();
          removeNum++;
        }
      }
    }

    return removeNum;
  }

