  // プレゼント
  function presentCheck() {
    if (!location.pathname.match(/\/user\/present/)) {
      return;
    }
    //すべてのプレゼントを受け取りにconfirmを追加
    $('div.ig_decksection_mid div:contains("ボックス内のアイテムは刷新後に引き継ぐことはできません")').css({
      'left': '415px',
      'width': '340px'
    });
    $('#ig_allbtn').on('click', function() {
      if (!confirm('すべてのプレゼントを受け取ってよろしいですか？')) {
        return false;
      }
    });
    //プレゼントの選択受け取り
    var get_target = function(html) {
      return $(html).find('input[name="id"]');
    },
    create_checkbox = function(html) {
      var $input = get_target($(html));
      $input.each(function() {
        var $label = $('<label>選択</label>').css({
            'margin': '0px 10px',
            'line-height': '1.7em',
            'color': 'black'
          }),
          $checkbox = $('<input />').attr({
            type: 'checkbox',
            name: 'select_' + $(this).val()
          }),
          target = $(this).parent().css('float', 'left');
        target.after($label.prepend($checkbox));
      });
    },
    get_selected = function() {
      var array = [],
        id, name;
      $('input[name^="select_"]').each(function() {
        id = $(this).attr('name').match(/\d+/g)[0];
        name = $(this).closest('tbody').find('p.para:eq(0) span').text();
        if ($(this).prop('checked')) {
          array.push({
            id: id,
            name: name
          });
        }
      });
      return array;
    },
    transmission = function(array) {
      var object = array.shift();
      $.ajax({
        type: 'post',
        url: '/user/present.php',
        data: {
          id: object.id
        },
        beforeSend: xrwStatusText
      })
      .then(function(html) {
        Info.log('【 ' + object.name + '】を受け取りました');
        if (array.length) {
          return  setTimeout(transmission, 500, array);
        } else {
          return Info.title('完了', location.href);
        }
      }, null);
    },
    start_receive = function() {
      var array = get_selected();

      if (!array.length) {
        moko_alert('選択項目が存在しません');
        return false;
      }
      if (!confirm('選択項目をすべて受け取ってよろしいですか？')) {
        return false;
      }
      nowLoading();
      Info.title('プレゼントを受け取り中...');
      return transmission (array);
    };

    var $html = $('div.ig_decksection_mid'),
      $input = get_target($html),
      $pager = $('ul.pager');

    if ($input.length) {
      $('<input />').attr({ type: 'button', id: 'select_receive',  value: '選択項目を受け取る' })
      .css({ 'float': 'right', 'margin-right': '205px' })
      .insertBefore('#presentAllForm')
      .click(start_receive);
      $('div.present_caution').css({
        'position': 'absolute',
        'right': '165px',
        'margin': '32px 0 0 0'
      });
      create_checkbox($html);
    }

    if (!$pager.length) {
      return;
    }
    //プレゼント オートページャー
    var page = $pager.find('span').text();
    $pager.data('add_page', parseInt(page) + 1);

    var add_page = parseInt($pager.data('add_page')),
      max_page;
    if ($pager.find('li.last a:last').length) {
      max_page = parseInt($pager.find('li.last a:last').attr('href').split('p=')[1]);
    } else {
      max_page = parseInt(page);
    }
    var add_next_page = function(add_page, max_page) {
        if (!add_next_page.flag) {
          add_next_page.flag = true;
        } else if (add_next_page.flag) {
          return;
        }
        var data = { p: add_page };
        if (location.pathname == '/user/present.php') {
          data.res = 1;
        }
        $.ajax({
          type: 'post',
          url: location.pathname,
          data: data,
          beforeSend: xrwStatusText
        })
        .then(function(html) {
          var $common_box3 = $(html).find('div.common_box3'),
            $cardWindow = $(html).find('div[id^="cardWindow_"]');
          if (location.pathname == '/user/present.php') {
            create_checkbox($common_box3);
          }
          $('div.ig_decksection_mid').append($common_box3);
          $('#sidebar').before($cardWindow);
          tb_init('a.thickbox');
          add_next_page.flag = false;
          add_page++;
          if (add_page > max_page) {
            add_next_page.flag = true;
            return moko_notice('全ページ読み込み完了', true);
          } else {
            $pager.data('add_page', add_page);
          }
        }, null);
      },
      adding_page = function() {
        var scroll_bottom = getScrollBottom();
        if (scroll_bottom < 5) {
          add_page = parseInt($('ul.pager').data('add_page'));
          return add_next_page(add_page, max_page);
        }
      };

    if (add_page > max_page) {
      return;
    }
    $(window).scroll(adding_page);
  }

