  // 特殊合成 経験値一括
  function getCardId(obj, rank, card_id, page) {
    var takeArray = function(arr) {
      var r = [];
      for (var i = 0, len = arr.length > 6 ? 6 : arr.length; i < len; i++) {
        r.push(arr[i]);
      }
      return r;
    };
    $.ajax({
      url: '/union/special.php',
      type: 'post',
      data: {
        select_card_group: 0,
        select_filter_num: 0,
        'sort_order[]': [4,3,0],
        'sort_order_type[]': [0,0,0],
        show_deck_card_count: 15,
        union_type: 5,
        btn_change_flg: 1,
        p: page
      }
    }).then(function(html) {
      var $html = $(html);
      var max_page = html_max_page($html);
      var $tr = $html.find('#busho_info tr.tr_gradient').slice(1);
      $tr.each(function(index, el) {
        var comment = $(this).find('td.skill_effect_comment').text();
        var cid = $(this).find('input[id^="card_id_arr"]').val();
        var card_name = $(this).find('a.busho_name').text();
        if (comment.indexOf('経験値を付与する') != -1) {
          if (card_name == 'すみれ' && rank > 2) {
            obj.sumire.push(cid);
          } else if (card_name != 'すみれ') {
            obj.koshou.push(cid);
          }
        }
      });
      if (max_page == page) {
        var card_id_arr;
        if (rank > 2 && obj.sumire.length && obj.koshou.length) {
          if (!confirm('「すみれ」以外のカードもセットしてよろしいですか？\n\n※優先されて使用される場合があります')) {
            card_id_arr = takeArray(obj.sumire);
            return setMaterial(card_id_arr, card_id);
          } else {
            card_id_arr = takeArray(obj.sumire.concat(obj.koshou));
          }
        } else {
          card_id_arr = takeArray(obj.sumire.concat(obj.koshou));
        }
        return setMaterial(card_id_arr, card_id);
      } else {
        page++;
        return getCardId(obj, rank, card_id, page);
      }
    });
  }
  function setMaterial(card_id_arr, card_id) {
    var param = {
      base_cid: card_id_arr.shift(),
      added_cid: card_id,
      add_flg: '',
      new_cid: '',
      remove_cid: '',
      p: 1,
      union_type: 5,
      btn_change_flg: ''
    };
    if (!param.base_cid) {
      moko_alert('経験値を付与できるカードがありません');
      return false;
    }
    if (card_id_arr.length) {
      param.material_cid = card_id_arr;
    }
    // sortを元に戻してから移動
    var sort_order = (function(){
      var array = [];
      $('select[name="sort_order[]"]').each(function(){
        array.push($(this).val());
      });
      return array;
    }());
    var sort_order_type = (function(){
      var array = [];
      $('select[name="sort_order_type[]"]').each(function(){
        array.push($(this).val());
      });
      return array;
    }());
    $.ajax({
      url: location.href,
      type: 'post',
      data: {
        select_card_group: $('input[name="select_card_group"]').val(),
        select_filter_num: $('input[name="select_filter_num"]').val(),
        'sort_order[]': sort_order,
        'sort_order_type[]': sort_order_type,
        show_deck_card_count: $('input[name="show_deck_card_count"]').val(),
        btn_change_flg: 1
      }
    }).then(function(html){
      return $.form({
        type: 'post',
        url: '/union/special_confirm.php',
        data: param
      });
    }, function(){
      alert('処理に失敗しました');
    });
  }

