              baseTitle1 = '(' + coordinate + ') ' + '人口' + popul + ' ' + baseData[2],
              baseTitle2 = mnbrName + '\n[' + type + '] ' + baseName + ' ' + baseTitle1;
              // 追加 2017/10/10 {
