  function addVillageList(list) {
    if (!list.length) {
      return keep_select_base();
    }
    var param = list.shift();
    $.ajax({
      type: 'post',
      url: param.href,
      beforeSend: xrwStatusText
    }).then(function(html) {
      var buildStatus = [],
        object;
      $(html).find('span.buildStatus').each(function() {
        buildStatus.push($(this).parent('li').text());
      });
      if (!buildStatus.length) {
        buildStatus.push('-');
      }
      for (var i = 0, len = buildStatus.length; i < len; i++) {
        object = $('<div />').css('line-height', '1.2').text(buildStatus[i]);
        if (object.text().indexOf('研究中') != -1) {
          object.css('color', 'lightBlue');
        }
        if (object.text().indexOf('削除中') != -1 || object.text().indexOf('陣の破棄') != -1) {
          object.css('color', '#aaa');
        }
        param.ins.find('td:last').append(object);
      }
      return addVillageList(list);
    }, null);
  }
